INSERT INTO `mfgs` (`id`, `shortname`, `fullname`, `www`, `address`, `note`) VALUES
(1, 'AVX', 'AVX Corporation', 'http://www.avx.com/', '', 'AVX Corporation is a leading international manufacturer and supplier of electronic passive components and interconnect solutions with multiple manufacturing and warehouse facilities located around the world.\r\n\r\nWe offer a broad range of devices including capacitors, resistors, filters, couplers, timing and circuit protection devices and connectors.'),
(2, 'Microchip', 'Microchip Technology Inc.', 'http://www.microchip.com/', '', 'Microchip Technology Inc. is a leading provider of microcontroller and analog semiconductors, providing low-risk product development, lower total system cost and faster time to market for thousands of diverse customer applications worldwide.'),
(3, 'NXP', 'NXP Semiconductors', 'http://www.nxp.com/', '', 'NXP Semiconductors N.V. (NASDAQ: NXPI) enables secure connections and infrastructure for a smarter world, advancing solutions that make lives easier, better and safer. As the world leader in secure connectivity solutions for embedded applications, NXP is driving innovation in the secure connected vehicle, end-to-end security & privacy and smart connected solutions markets. Built on more than 60 years of combined experience and expertise, the company has 45,000 employees in more than 35 countries.'),
(4, 'ST', 'STMicroelectronics', 'http://www.st.com', '', 'STMicroelectronics is one of the world’s largest semiconductor companies with net revenues of US$ 7.40 billion in 2014. Offering one of the industry’s broadest product portfolios, ST serves customers across the spectrum of electronics applications with innovative semiconductor solutions by leveraging its vast array of technologies, design expertise and combination of intellectual property portfolio, strategic partnerships and manufacturing strength.'),
(5, 'Infineon', 'Infineon Technologies', 'http://www.infineon.com', '', 'Infineon Technologies AG is a German semiconductor manufacturer founded on 1 April 1999, when the semiconductor operations of the parent company Siemens AG were spun off to form a separate legal entity.\r\n\r\nInfineon Technologies AG, in Neubiberg near Munich, offers semiconductors and systems for automotive, industrial, and multimarket sectors, as well as chipcard and security products. With a global presence, Infineon operates through its subsidiaries in the USA, from Milpitas, California, and in the Asia-Pacific region, from Singapore and from Tokyo, Japan.'),
(6, 'Kingbright', 'Kingbright Electronic Co.', 'http://www.kingbright.com', '', 'The Kingbright group was founded in 1980 as one of Taiwan’s LED pioneers. Over the last 30 years, we have grown from a small local business to a multi-national enterprise spanning Europe, America, and Asia. Our products are found in computers, consumer electronics, automotive, lighting, and many other applications. The Kingbright brand is trusted by customers world-wide as a world-class manufacturer of LEDs, one of the top-three LED packagers in Taiwan. The group has over 2,000 employees and more than 38,000 sq. meters of automated production facilities.'),
(7, 'Optoflash', 'Optoflash TME', 'http://www.tme.eu', '', 'Optoflash is the trademark of TME.'),
(8, 'Semtech', 'Semtech Corporation', 'http://www.semtech.com/', '', 'Semtech Corporation is a leading supplier of high-quality analog and mixed-signal semiconductor products. We are dedicated to providing you with proprietary solutions and breakthrough technology in power management, circuit protection, timing and synchronization, touch interface, video broadcasting, high-performance optical transport equipment (SerDes), high-reliability military products, low-power wireless RF, and digital sensor/signal conditioning ICs. Our products are used in some of the most innovative systems and in some of the fastest growing markets in the industry. These markets include Smartphones, LCD TVs, Notebook Computers, Wireless LAN Modems, Automatic Meter Reading, Ultra-Low Power Medical, Satellite Communication, Cellular Infrastructure, Optical Transport and Datacenters.'),
(9, 'TE', 'TE Connectivity', 'http://www.te.com', '', 'TE Connectivity Ltd. designs and manufactures connectivity and sensor solutions for a variety of industries including automotive, industrial equipment, data communication systems, aerospace, defense, oil and gas, consumer electronics, energy and subsea communications.'),
(10, 'Molex', 'Molex Incorporated', 'http://www.molex.com', '', 'Molex Incorporated is a manufacturer of electronic interconnectors. Molex sells over 100,000 products, including everything from electrical and fiber optic interconnect solutions to switches and application tooling. Molex supplies a variety of industries, including the telecom, datacom, computer and peripheral, automotive, premises wiring, industrial, consumer, medical and military markets.'),
(11, 'Vishay', 'Vishay Intertechnology', 'http://www.vishay.com', '', 'Vishay Intertechnology, Inc. is an American manufacturer of discrete semiconductors and passive electronic components.'),
(12, 'Connfly', 'Connfly Electronics Co.', 'http:/www.connfly.com', '', ''),
(13, 'Meanwell', 'Mean Well ', 'http://www.meanwell.com', '', 'Established in 1982, MEAN WELL is a leading standard switching power supply manufacturers in the world. MEAN WELL currently operates under five financially independent but cooperating companies in Taiwan, China, USA and Europe. The five companies include MEAN WELL Enterprises Co., Ltd., MEAN WELL (GuangZhou) Electronics Co., Ltd., SuZhou MEAN WELL Technology Co., Ltd., MEAN WELL USA, Inc. and MEAN WELL Europe B.V.. Our product lines include AC/DC switching power supplies, DC/DC converters, DC/AC inverters and battery chargers. '),
(14, 'TI', 'Texas Instruments', 'http://www.ti.com', '', '');
